import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { FaUserCircle, FaInfoCircle, FaSignOutAlt, FaTrashAlt } from 'react-icons/fa';

const Dashboard = () => {
  const navigate = useNavigate();

  // Simulate fetching user data (replace with API call)
  const [user, setUser] = useState(null);

  useEffect(() => {
    // Simulated user data
    const fetchData = async () => {
      const userData = {
        name: 'John Doe',
        email: 'john.doe@example.com',
        profilePic: 'https://via.placeholder.com/100', // Replace with real profile URL
      };
      setUser(userData);
    };
    fetchData();
  }, []);

  const handleNavigate = (path) => navigate(path);

  return (
    <div
      style={{
        fontFamily: "'Roboto', sans-serif",
        backgroundColor: '#f3f4f6',
        minHeight: '100vh',
        display: 'flex',
        flexDirection: 'column',
      }}
    >
      {/* Header */}
      <header
        style={{
          backgroundColor: '#1f2937',
          color: '#fff',
          display: 'flex',
          justifyContent: 'space-between',
          alignItems: 'center',
          padding: '10px 20px',
        }}
      >
        <div>
          <h2 style={{ margin: 0 }}>Dashboard</h2>
        </div>
        <div style={{ display: 'flex', alignItems: 'center', gap: '15px' }}>
          {user && (
            <>
              {/* User Profile */}
              <div
                style={{
                  display: 'flex',
                  alignItems: 'center',
                  gap: '10px',
                  cursor: 'pointer',
                }}
              >
                <img
                  src={user.profilePic}
                  alt="Profile"
                  style={{ width: '40px', height: '40px', borderRadius: '50%' }}
                />
                <div>
                  <p style={{ margin: 0, fontWeight: 'bold' }}>{user.name}</p>
                  <small style={{ color: '#9ca3af' }}>{user.email}</small>
                </div>
              </div>
            </>
          )}
          {/* Action Buttons */}
          <FaInfoCircle
            size={20}
            style={{ cursor: 'pointer', color: '#60a5fa' }}
            onClick={() => handleNavigate('/about')}
            title="About"
          />
          <FaSignOutAlt
            size={20}
            style={{ cursor: 'pointer', color: '#f87171' }}
            onClick={() => handleNavigate('/logout')}
            title="Logout"
          />
          <FaTrashAlt
            size={20}
            style={{ cursor: 'pointer', color: '#ef4444' }}
            onClick={() => handleNavigate('/delete-account')}
            title="Delete Account"
          />
        </div>
      </header>

      {/* Welcome Section */}
      {user && (
        <div
          style={{
            padding: '20px',
            backgroundColor: '#3b82f6',
            color: '#fff',
            textAlign: 'center',
          }}
        >
          <h2>Welcome, {user.name}!</h2>
          <p>Here are your available options:</p>
        </div>
      )}

      {/* Main Content */}
      <main
        style={{
          flexGrow: 1,
          display: 'flex',
          flexDirection: 'column',
          justifyContent: 'center',
          alignItems: 'center',
          gap: '30px',
        }}
      >
        <div
          style={{
            display: 'grid',
            gridTemplateColumns: 'repeat(auto-fit, minmax(250px, 1fr))',
            gap: '20px',
            width: '80%',
            maxWidth: '800px',
          }}
        >
          <button
            onClick={() => handleNavigate('/clubs')}
            style={buttonStyle('#3b82f6')}
          >
            View Clubs
          </button>
          <button
            onClick={() => handleNavigate('/events')}
            style={buttonStyle('#10b981')}
          >
            View Events
          </button>
          <button
            onClick={() => handleNavigate('/resources')}
            style={buttonStyle('#f59e0b')}
          >
            View Resources
          </button>
        </div>
      </main>

      {/* Footer */}
      <footer
        style={{
          textAlign: 'center',
          padding: '10px 20px',
          backgroundColor: '#1f2937',
          color: '#9ca3af',
        }}
      >
        ©CSE CU Association
      </footer>
    </div>
  );
};

// Reusable button style function
const buttonStyle = (bgColor) => ({
  padding: '20px',
  backgroundColor: bgColor,
  color: '#fff',
  border: 'none',
  borderRadius: '10px',
  cursor: 'pointer',
  fontSize: '18px',
  fontWeight: '500',
  boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
  transition: 'transform 0.2s, box-shadow 0.2s',
  textAlign: 'center',
  display: 'flex',
  alignItems: 'center',
  justifyContent: 'center',
});

export default Dashboard;
